-- 导出  表 fes4bank.pr_apply 结构
CREATE TABLE IF NOT EXISTS `pr_apply` (
  `slbh` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '受理编号',
  `qzbh` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '权证编号',
