  `dyqrbh` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '抵押权人编号',
  `ywlx` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '业务类型:普通抵押、预告抵押、在建抵押',
  `dyfs` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '抵押方式:一般抵押、最高额抵押',
  `dyje` float NOT NULL COMMENT '本次抵押金额',
  `dymj` float NOT NULL COMMENT '房屋抵押面积,<=实际建筑面积',
  `bdcjz` float NOT NULL COMMENT '不动产价值,>本次抵押金额',
  `dbfw` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '抵押担保范围,默认：全部抵押',
  `stime` datetime NOT NULL COMMENT '债务履行期限起',
  `etime` datetime NOT NULL COMMENT '债务履行期限止',
