  `slry` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '受理人员',
  `tzr` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '通知人',
  `tzdh` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '通知电话',
  `tzrdz` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '通知人地址',
  `tzbz` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '通知备注',
  `status` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '0:暂存(未提交)1:提交(未受理)2:受理3:收件4:录入5:审核6:缮证8:退件',
  `utime` datetime NOT NULL COMMENT '状态最后更新时间',
  `bz` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '返回的信息备注',
  PRIMARY KEY (`slbh`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='抵押申请表';

